style.css:
/* Reset some default styles to ensure consistent styling across browsers */
body, h1, p {
  margin: 0;
  padding: 0;
}

/* Set a background color for the whole page */
body {
  background-color: #f4f4f4;
  font-family: Arial, sans-serif;
}

/* Style the header with a background color, text color, and padding */
header {
  background-color: #333;
  color: #fff;
  padding: 10px;
  text-align: center;
}

/* Style the main content area with some padding */
main {
  padding: 20px;
}

/* Style headings and paragraphs */
h1, h2, h3 {
  color: #333;
}

p {
  line-height: 1.5;
}

/* Style links with different colors for normal, hover, and visited states */
a {
  color: #007bff;
}

a:hover {
  color: #0056b3;
}

a:visited {
  color: #purple;
}

/* Style a simple navigation menu */
nav {
  background-color: #eee;
  padding: 10px;
}

nav a {
  margin-right: 15px;
  text-decoration: none;
  color: #333;
}

/* Style a footer with a fixed position at the bottom of the page */
footer {
  position: fixed;
  bottom: 0;
  left: 0;
  width: 100%;
  background-color: #333;
  color: #fff;
  text-align: center;
  padding: 10px;
}
